import '../Styles/root-themes.css';

import { Drawer } from 'antd';
import CustomInput from './CustomInput'



function CreateRoom(props) {

  return (
    <div>

<Drawer 
        closable={true} 
        onClose={closeCreateAccountDrawer}
        title="" 
        footer={null} 
        visible={props.createAccountDrawerVisible}
        getContainer={true}
        style={{ position: 'absolute' }}
        placement="bottom"
        height="700"

        >
          <h1>Create account.</h1>

          <CustomInput
                title="Username."
                placeholder="placeholder..."
                onChange={null}
                value={null}
            />
            <CustomInput
                title="Password."
                placeholder="placeholder..."
                onChange={null}
                value={null}
            />
            <CustomInput
                title="Number."
                placeholder="placeholder..."
                onChange={null}
                value={null}
            />
            <CustomInput
                title="Access Code."
                placeholder="placeholder..."
                onChange={null}
                value={null}
            />
            <button className="root-theme-push-top" >
              Create account.
            </button>
      </Drawer>






    </div>

  );
}


export default CreateRoom;
